window.bookSummaryJSON = "<p>This was supposed to be my fresh start. It was supposed to be my new beginning, my time to take care of me. But then I meet Dean Shelby and my world turns upside down.</p> <p>I'm head over heels and my fresh is starting to feel more like a whirlwind. He's perfect in every single way...but will he still be perfect when he finds out I'm pregnant?</p> <p>From the moment I first laid eyes on her, I knew she was different. Maybe it's the small town kindness. Maybe it's her emerald green eyes. Maybe it's her killer curves driving me wild. Whatever it is, I want her more than I've ever wanted anyone before. I'm ready to sweep her off her feet and make this fairy tale come true, but my family have other plans for me.</p> <p>I know one thing is certain: They won't be happy when I finally stand up and tell them \"no.\"</p> <p><b>Contains mature themes.</b></p>"; 
